import React from "react";
import "./App.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFacebook, faFacebookF, faGithub, faInstagram, faLinkedin, faYoutube } from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";

function App() {
  // const scrollToDiv = (ref) => window.scrollTo(0, ref.current.offsetTop);
  // const el1 = useRef();
  // const el2 = useRef();
  return (
    <div className="bgImage">
      <div className="bgBlack overflow-scroll">
        <div
          id="landingPage"
          className="container d-flex flex-row justify-content-center justify-content-md-start align-items-center w-100 h-100"
        >
          <div className="row w-100">
            <div className="col-12 col-md-6">
              <h1 className="mainTitle text-white text-md-start text-center my-2">Achyut Neupane</h1>
            </div>
            <div class="col-12">
              <div className="d-flex flex-row justify-content-center text-white gap-2">
                <FontAwesomeIcon icon={faFacebookF} size='2x' style={{ color: '#3b5998' }}/>
                <FontAwesomeIcon icon={faInstagram} size='2x' style={{ color: '#833AB4' }}/>
                <FontAwesomeIcon icon={faLinkedin} size='2x' style={{ color: '#0e76a8' }}/>
                <FontAwesomeIcon icon={faGithub} size='2x' style={{ color: '#ffffff' }}/>
                <FontAwesomeIcon icon={faYoutube} size='2x' style={{ color: '#c4302b' }}/>
                <FontAwesomeIcon icon={faEnvelope} size='2x' style={{ color: '#000000' }}/>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
